import React, { useState } from "react";
import "../Components/MailChecker.css";

function MailChecker(props) {
  const [allMail, setAllMail] = useState("");

  function saveHandler(e) {
    e.preventDefault();
    setAllMail(props.onMailCheck);
  }
  console.log(allMail);

  return (
    <div>
      <button onClick={saveHandler}>Try your luck</button>
    </div>
  );
}

export default MailChecker;
